    <ContainerStyled>
      <div className='left-content'>
        Hi
      </div>
      <div className='right-content'>
        Hey
      </div>
    </ContainerStyled>
  )
}

const ContainerStyled = styled.div`
  display: inline-block;
  vertical-align: top;
  width: 50%;
  padding: 1rem;

  .left-content{
    background: palevioletred;
  }

  .right-content{
    background: palegoldenrod;
  }
`

export default CommentSection
